import React from 'react';

import ErrorBoundry from '../error-boundry';

import './app.css';
import {withBookstoreService} from '../hoc';

const App = ({ bookstoreService }) => {
    console.log(bookstoreService.getBooks())
    return(
        <ErrorBoundry>
            <h1>Hello World</h1>
        </ErrorBoundry>
    );
}

export default withBookstoreService()(App);
